  `transporte` enum('1','2','3') DEFAULT '1',
  `nasignado` int(11) DEFAULT '0',
  `nordensorteo` int(11) DEFAULT '0',
  `estado_solicitud` enum('irregular','duplicada','apta') DEFAULT 'apta',
  `oponenautorizar` tinyint(4) DEFAULT '0',
